pragma solidity ^0.4.19;

import "./ownable.sol";

contract MicroCredential is Ownable {

    Agency private agency;

    struct Agency {
        bytes32 name;
        bytes32 website;
        bytes32 email;
        int perReviewFeeInPirl;
        bool isActive;
    }


    // What would I do in a constructor?



    // Sets the contract owners contact info
    function SetAgency(bytes32 _name, bytes32 _website, bytes32 _email, int _perReviewFeeInPirl, bool _isActive) public onlyOwner {
        agency.name = _name;
        agency.website = _website;
        agency.email = _email;
        agency.perReviewFeeInPirl = _perReviewFeeInPirl;
        agency.isActive = _isActive;
    }

    function GetAgencyInfo() constant public returns (bytes32, bytes32, bytes32, int, bool) {
        return (agency.name, agency.website, agency.email, agency.perReviewFeeInPirl, agency.isActive);
    }



}
